import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import ExpansionPanel from '@material-ui/core/ExpansionPanel';
import ExpansionPanelSummary from '@material-ui/core/ExpansionPanelSummary';
import ExpansionPanelDetails from '@material-ui/core/ExpansionPanelDetails';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import TextField from '@material-ui/core/TextField';

import './css/FirstPage.css'

class First extends Component {
  onSave = () => {
    const { getSt } = this.props;
    if (this.input.value) {
      getSt({ name: this.input.value });
    }
  };
  render() {
    return (
      <div className="firstPageContainer">
        <div className="firstPageLeft">
          <Paper>
            <ExpansionPanel>
              <ExpansionPanelSummary expandIcon={<ExpandMoreIcon />}>
                <Typography>Список дел</Typography>
              </ExpansionPanelSummary>
              <ExpansionPanelDetails className="firstPageList">
                <List className="firstPageListItem">
                  <ListItem role={undefined} dense button>
                    <ListItemText primary="Сегодня" />
                  </ListItem>
                  <ListItem role={undefined} dense button>
                    <ListItemText primary="Завтра" />
                  </ListItem>
                  <ListItem role={undefined} dense button>
                    <ListItemText primary="Неделя" />
                  </ListItem>
                  <ListItem role={undefined} dense button>
                    <ListItemText primary="Месяц" />
                  </ListItem>
                  <ListItem role={undefined} dense button>
                    <ListItemText primary="Год" />
                  </ListItem>
                </List>
              </ExpansionPanelDetails>
            </ExpansionPanel>
            <ExpansionPanel>
              <ExpansionPanelSummary expandIcon={<ExpandMoreIcon />}>
                <Typography>Календарь</Typography>
              </ExpansionPanelSummary>
              <ExpansionPanelDetails>
                <Typography>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse malesuada lacus ex,
                  sit amet blandit leo lobortis eget.
                </Typography>
              </ExpansionPanelDetails>
            </ExpansionPanel>
          </Paper>
        </div>
        <div className="firstPageRight">
          <Paper>
          <div>
            <button onClick={ () => this.onSave() }> Get ST </button>
            <TextField
              fullWidth
              inputRef={(ref) => {
                this.input = ref;
              }}
            />
          </div>
          <div>
            {
              this.props.testReducers.map((st, index) =>
                <p key={index}>{st}</p>
              )
            }
          </div>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Dessert (100g serving)</TableCell>
                  <TableCell align="right">Calories</TableCell>
                  <TableCell align="right">Fat</TableCell>
                  <TableCell align="right">Carbs</TableCell>
                  <TableCell align="right">Protein</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                <TableRow>
                  <TableCell align="right">123</TableCell>
                  <TableCell align="right">222</TableCell>
                  <TableCell align="right">3</TableCell>
                  <TableCell align="right">44</TableCell>
                  <TableCell align="right">55</TableCell>
                </TableRow>
              </TableBody>
            </Table>
          </Paper>
        </div>
      </div>
    );
  }
}

export default First;
